并且点击信息修改又无法修改信息，提示没有办理未就业登记或实名登记。但是实际账号已经实名登记，而且没有给出提示去哪里办理，全网搜索都不知道怎么办理。基本处于办事根本办不了的情况。

导致最后无法登记，从而没法领取基层就业补贴。","transactTime":"2023-12-19","transactResult":"尊敬的网民游远：您好！对于您在“我为政府网站找错”栏目留言的问题，我局已收悉，并立即对问题进行核实。已联系相关部门处理，将由工作人员联系您，请保持电话通畅。感谢您的留言，希望您一如既往关注和支持我局网站建设。"}],"hasMoreItems":false}
